using namespace std;

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);
    
    char e[] = "";
    
    int n, cnt;
    while (true) {
        cnt = 0;
        cin >> n;
        if (n == 0) break;
        else {
            for (int i = n + 1; i <= 2 * n; i++) {
                cnt += (e[i] == '1' ? 0 : 1);
            }
        }
        cout << cnt << '\n';
    }
    
    return 0;
}

